id tilbage med en eller anden form for mad/snack\\nDe er det perfekte makkerpar.\\n\\nEn dag beslutter hun sig for at blive en del af det brændende svær i håb om at finde ud af hvorfor [[Osty]] forsvandt - ingen ved hvordan dette kommer til at ende.logseq____&quot;,536870970]],[logseq____&quot;^15logseq____&quot;,[976,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1@logseq____&quot;,536870970]],[logseq____&quot;^15logseq____&quot;,[976,logseq____&quot;^Flogseq____&quot;,968,536870970]],[logseq____&quot;^15logseq____&quot;,[976,logseq____&quot;^Xlogseq____&quot;,284,536870970]],[logseq____&quot;^15logseq____&quot;,[976,logseq____&quot;^Vlogseq____&quot;,284,536870970]],[logseq____&quot;^15logseq____&quot;,[976,logseq____&quot;^Ulogseq____&quot;,284,536870970]],[logseq____&quot;^15logseq____&quot;,[976,logseq____&quot;^Ulogseq____&quot;,285,536870970]],[logseq____&quot;^15logseq____&quot;,[976,logseq____&quot;^Ulogseq____&quot;,426,536870970]],[logseq____&quot;^15logseq____&quot;,[976,logseq____&quot;^?logseq____&quot;,[logseq____&quot;^ logseq____&quot;,logseq____&quot;^3Elogseq____&quot;,3],536870970]],[logseq____&quot;^15logseq____&quot;,[976,logseq____&quot;^Jlogseq____&quot;,[],536870970]],[logseq____&quot;^15logseq____&quot;,[976,logseq____&quot;^Hlogseq____&quot;,285,536870970]],[logseq____&quot;^15logseq____&quot;,[976,logseq____&quot;^Hlogseq____&quot;,426,536870970]],[logseq____&quot;^15logseq____&quot;,[976,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u6646554e-3c02-494d-9fcf-2ce724616fcalogseq____&quot;,536870970]],[logseq____&quot;^15logseq____&quot;,[978,logseq____&quot;^Klogseq____&quot;,1715885390146,536870971]],[logseq____&quot;^15logseq____&quot;,[978,logseq____&quot;^@logseq____&quot;,false,536870971]],[logseq____&quot;^15logseq____&quot;,[978,logseq____&quot;^Ylogseq____&quot;,logseq____&quot;anariel  saint of stormslogseq____&quot;,536870971]],[logseq____&quot;^15logseq____&quot;,[978,logseq____&quot;^11logseq____&quot;,logseq____&quot gt.\\n\\nFor nyligt har han besluttet sig for at det er irrelevant at være vagt for han kan kun beskytte ting så længe han er der, og så snart han er væk kan alting gå galt alligevel. Uanset hvor mange banditter han slår ihjel kommer der bare flere så længe lederen som sidder hjemme i skjulet stadig er i live. \\nDerfor har han besluttet sig for at vende tilbage til sine evner som spion/agent og forhåbentligt gøre en forskel ved at gå efter mere strategiske mål som har indflydelse. Folk som korrupte politikere, bandit ledere og deslige\\n\\nSit kaldenavn \\logseq____&quot;[[Lark]]\\logseq____&quot; fik han som barn som kodenavn hos sin kontakt fordi han var god til at imitere fuglelyde/sang og holdt til i skovenlogseq____&quot;,536871030]],[logseq____&quot;^15logseq____&quot;,[1272,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1@logseq____&quot;,536871030]],[logseq____&quot;^15logseq____&quot;,[1272,logseq____&quot;^Flogseq____&quot;,1280,536871030]],[logseq____&quot;^15logseq____&quot;,[1272,logseq____&quot;^Xlogseq____&quot;,24,536871030]],[logseq____&quot;^15logseq____&quot;,[1272,logseq____&quot;^Vlogseq____&quot;,24,536871030]],[logseq____&quot;^15logseq____&quot;,[1272,logseq____&quot;^Ulogseq____&quot;,24,536871030]],[logseq____&quot;^15logseq____&quot;,[1272,logseq____&quot;^?logseq____&quot;,[logseq____&quot;^ logseq____&quot;,logseq____&quot;^3Elogseq____&quot;,3],536871030]],[logseq____&quot;^15logseq____&quot;,[1272,logseq____&quot;^Jlogseq____&quot;,[],536871030]],[logseq____&quot;^15logseq____&quot;,[1272,logseq____&quot;^Hlogseq____&quot;,24,536871030]],[logseq____&quot;^15logseq____&quot;,[1272,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u6646554e-28c4-4379-8a39-8a0df48852f2logseq____&quot;,536871030]],[logseq____&quot;^15logseq____&quot;,[1273,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;logseq____&quot;,536871030]],[logseq____&quot;^15logseq____&quot;,[1273,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1@logseq____&quot;,5  <script type="text/javascript">// Single Page Apps for GitHub Pages

      // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
      }(window.location))</script>
